    clientSecret: 'N5RqR_DXO6trI8EAId0Fsz_ZwDyPXEtk8Vyv2xt2fJRnw4DTvz7Mc3mhec3zTVmO',
    scope: 'user',
    domain: 'devplenostatus.auth0.com',
    redirectUri: 'https://devplenostatus.auth0.com',
    postLogoutRedirectUri: 'http://localhost:3000',
    session: {
        cookieSecret: 'shfsufgsufgsufgusfgusgfusgfsufgs',
        cookieLifetime: 3600
